import React from 'react';
import './Setting.css';
import { Route, Link } from 'react-router-dom';
import General from './General.jsx';
import MainMenu from './MainMenu.jsx';
import SecurityAndLogin from './SecurityAndLogin';
import { Col, Row } from 'antd';

function Setting() {
    return (
        <>
            <div className="setting-container" >
                <div className="setting-main-content">
                    <Row>
                        <Col span={4}>
                            <MainMenu />
                        </Col>
                        <Col span={8}>
                            <div className="setting-content" style={{ margin: '20px 0' }}>
                                <Route exact path="/setting" component={General} />
                                <Route path="/setting/securityandlogin" component={SecurityAndLogin} />
                            </div>
                        </Col>
                    </Row>
                </div>
            </div>
        </>
    )
}

export default Setting;
